import React, {useState} from 'react'
import Dinner from './Dinner.jpg'
import './LandingP.css'
import Hamburguesa from './Hamburguesa.jpg'
import Mordida  from './Mordida.jpg'

export default function LandingP() {

  const [hovered, setHovered] = React.useState(false);

  const handleMouseOver = () => {
    setHovered(true);
  };

  const handleMouseOut = () => {
    setHovered(false);
  };
  
  return (
    <div>
      <div>HENRY FOODS</div>
      <div className='container'>
        <div className='left-div'>
          <h1>Bienvenido a Henry Food</h1>
          <h3>Aquí puedes encontrar información sobre más de 5.000 recetas para que prepares el plato que más te gusta</h3>
          { hovered ? (<img 
                        src={Mordida} alt='Food' 
                        style={{width: '150px', height: '150px', cursor: 'pointer'}} 
                        onMouseOut={handleMouseOut}
                        />) :
                      ((<img 
                        src={Mordida} 
                        alt='Food' 
                        style={{width: '150px', height: '150px', cursor: 'pointer'}} 
                        onMouseOver={handleMouseOver}/>))
          }
        </div>
        <div className='right-div'>
            <img src={Dinner} alt='Food' style={{width: '100%', height: 'auto'}} ></img>
        </div>
      </div>
    </div>
  )
}
